import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import mockData from "./mock_sample.json";
import "./ManCallPage.css";

function ManCalllistPage_CalllistPage() {
  const [rowData, setRowData] = useState(null);

  // 통화 목록 데이터 추출 함수
  const extractCallListData = () => {
    // JSON 데이터에서 필요한 정보 추출
    const extractedData = mockData.map(
      ({ id, name, date, time, cluster, keyword }) => ({
        id,
        name,
        date,
        time,
        cluster,
        keyword,
      })
    );

    setRowData(extractedData); // 추출된 데이터 설정
  };

  // 페이지 렌더링 시 통화 목록 데이터 추출
  useEffect(() => {
    extractCallListData();
  }, []); // useEffect 의존성 배열이 빈 배열로 설정되어 있음

  return (
    <div>
      {/* 데이터가 존재하면 출력 */}
      {rowData && (
        <div>
          <table className="table-container">
            <thead>
              <tr>
                <th>이름</th>
                <th>날짜</th>
                <th>시간</th>
                <th>분류</th>
                <th>키워드</th>
                <th>더보기</th>
              </tr>
            </thead>
            <tbody>
              {rowData.map((data, index) => (
                <tr key={index}>
                  <td>{data.name}</td>
                  <td>{data.date}</td>
                  <td>{data.time}</td>
                  <td>{data.cluster}</td>
                  <td>
                    <div className="keyword-container">
                      {data.keyword.map((keyword, keywordIndex) => (
                        <div key={keywordIndex} className="keyword-box">
                          {keyword}
                        </div>
                      ))}
                    </div>
                  </td>
                  <td>
                    <Link
                      to={`/manager/calllist/call/${data.id}`}
                      className="link-more"
                    >
                      더보기
                    </Link>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default ManCalllistPage_CalllistPage;
